import * as React from 'react';
import data from '../data/data';
import { ListGroup, ListGroupItem } from 'reactstrap';
import Sex from './Sex';
interface IOverviewProps {}

export const Overview: React.FunctionComponent<IOverviewProps> = (props) => {
  console.log(data);

  const numberOfMales = data.filter((a) => a.sex === 'Male').length;
  const numberOfFemales = data.filter((a) => a.sex === 'Female').length;

  const sexStats = [numberOfMales, numberOfFemales];

  return (
    <ListGroup>
      <ListGroupItem>Total confirmed case: {data.length}</ListGroupItem>
      <ListGroupItem>
        <Sex stats={sexStats} />
      </ListGroupItem>
      <ListGroupItem></ListGroupItem>
    </ListGroup>
  );
};
